import React from 'react';
import Styles from './Login.module.css';
import {Formik} from  'formik';
const Login = ()=>{
    return (
        <div className = {Styles.container}>
            <Formik
                initialValues = {{email : '', password : ''}}
            >

            </Formik>

        </div>
    )
}
export default Login;
